  "convertNativeToDart_AcceptStructuredClone" : 
    "name" : "convertNativeToDart_AcceptStructuredClone"
    "qualifiedname" : "html_common.convertNativeToDart_AcceptStructuredClone"
    "comment" : "<p>Converts a native value into a Dart object.</p> <p>If <code>mustCopy</code> is <code>:false:</code>, may return the original input.  May mutate the original input (but will be idempotent if mutation occurs).  It is assumed that this conversion happens on native serializable script values such values from native DOM calls.</p> <p><code>object</code> is the result of a structured clone operation.</p> <p>If necessary, JavaScript Dates are converted into Dart Dates.</p> <p>If <code>mustCopy</code> is <code>:true:</code>, the entire object is copied and the original input is not mutated.  This should be the case where Dart and JavaScript code can access the value, for example, via multiple event listeners for MessageEvents.  Mutating the object to make it more 'Dart-like' would corrupt the value as seen from the JavaScript listeners.</p>"
    "type" : "method"
    "static" : "false"
    "return" : "dynamic"
    "parameters" : 
      "object" : 
        "name" : "object"
        "qualifiedname" : "html_common.convertNativeToDart_AcceptStructuredClone#object"
        "optional" : "false"
        "named" : "false"
        "default" : "false"
        "type" : "dynamic"
        "value" : "null"
      "mustCopy" : 
        "name" : "mustCopy"
        "qualifiedname" : "html_common.convertNativeToDart_AcceptStructuredClone#mustCopy"
        "optional" : "true"
        "named" : "true"
        "default" : "true"
        "type" : "dynamic"
        "value" : "false"
