    "name" : "_convertDartToNative_PrepareForStructuredClone"
    "qualifiedname" : "html_common._convertDartToNative_PrepareForStructuredClone"
    "comment" : "<p>Converts a Dart value into a JavaScript SerializedScriptValue.  Returns the original input or a functional 'copy'.  Does not mutate the original.</p> <p>The main transformation is the translation of Dart Maps are converted to JavaScript Objects.</p> <p>The algorithm is essentially a dry-run of the structured clone algorithm described at http://www.whatwg.org/specs/web-apps/current-work/multipage/common-dom-interfaces.html#structured-clone https://www.khronos.org/registry/typedarray/specs/latest/#9</p> <p>Since the result of this function is expected to be passed only to JavaScript operations that perform the structured clone algorithm which does not mutate its output, the result may share structure with the input <code>value</code>.</p>"
    "type" : "method"
    "static" : "false"
    "return" : "dynamic"
    "parameters" : 
      "value" : 
        "name" : "value"
        "qualifiedname" : "html_common._convertDartToNative_PrepareForStructuredClone#value"
